import shoplist from '../../assets/shop-store.json'
//id name imageUrl price
const Shop = () =>{
    const {id,name,imageUrl,price} = shoplist;
    return(
        <div>
            {shoplist.map((item)=>{
                return(

                    <div key={item.id}>
                        {item.name}
                        <p>{item.price}</p>
                    <img className='background-image' src={item.imageUrl} alt = {`clothing type ${item.name}`} ></img>
                    <div style={{backgroundImage :`url(${item.imageUrl})`}}></div>
                    </div>

                )
            })}
        </div>
    )
}
export default Shop
